import React from "react";
import Button from '@mui/material/Button';
import TextField from '@mui/material/TextField';
import Box from '@mui/material/Box';
import Typography from '@mui/material/Typography';
import IconButton from '@mui/material/IconButton';
import Visibility from '@mui/icons-material/Visibility';
import VisibilityOff from '@mui/icons-material/VisibilityOff';
import Link from '@mui/material/Link';

const initialObject = {
  username: "",
  email: "",
  password: "",
};

function RegistrationForm(props) {
  const [formInitData, setFormInItData] = React.useState(initialObject);
  const [passwordVisible, setPasswordVisible] = React.useState(false);
  const [errors, setErrors] = React.useState({});

  const handlePasswordShow = () => {
    setPasswordVisible(!passwordVisible);
  }

  const handleInputFields = (e) => {
    console.log("e :: ", e.target.value);
    let updateValue = { ...formInitData };
    updateValue[e.target.name] = e.target.value;
    setFormInItData(updateValue);
  }

  const handleSubmit = (event) => {
    event.preventDefault();
    // const data = new FormData(event.currentTarget);
    // console.log({
    //   username: data.get('username'),
    //   email: data.get('email'),
    //   password: data.get('password'),
    // });

    event.preventDefault();
    if (validateForm()) {
      alert("Form submitted");
    }

  };

  const validateForm = () => {
    let fields = { ...formInitData };
    let errors = {};
    let formIsValid = true;

    if (!fields["username"]) {
      formIsValid = false;
      errors["username"] = "*Please enter your username.";
    }

    if (typeof fields["username"] !== "undefined") {
      if (!fields["username"].match(/^[a-zA-Z ]*$/)) {
        formIsValid = false;
        errors["username"] = "*Please enter alphabet characters only.";
      }
    }

    if (!fields["email"]) {
      formIsValid = false;
      errors["email"] = "*Please enter your email.";
    }

    if (typeof fields["email"] !== "undefined") {
      //regular expression for email validation
      var pattern = new RegExp(/^(("[\w-\s]+")|([\w-]+(?:\.[\w-]+)*)|("[\w-\s]+")([\w-]+(?:\.[\w-]+)*))(@((?:[\w-]+\.)*\w[\w-]{0,66})\.([a-z]{2,6}(?:\.[a-z]{2})?)$)|(@\[?((25[0-5]\.|2[0-4][0-9]\.|1[0-9]{2}\.|[0-9]{1,2}\.))((25[0-5]|2[0-4][0-9]|1[0-9]{2}|[0-9]{1,2})\.){2}(25[0-5]|2[0-4][0-9]|1[0-9]{2}|[0-9]{1,2})\]?$)/i);
      if (!pattern.test(fields["email"])) {
        formIsValid = false;
        errors["email"] = "*Please enter valid email.";
      }
    }

    if (!fields["password"]) {
      formIsValid = false;
      errors["password"] = "*Please enter your password.";
    }

    // if (typeof fields["password"] !== "undefined") {
    //   if (!fields["password"].match(/^.*(?=.{2,})(?=.*\d)(?=.*[a-z])(?=.*[A-Z])(?=.*[@#$%&]).*$/)) {
    //     formIsValid = false;
    //     errors["password"] = "*Please enter secure and strong password.";
    //   }
    // }

    if (typeof fields["password"] !== "undefined") {
      if (fields["password"]?.length >= 8) {
        formIsValid = false;
        errors["password"] = "*Minimum password length is 8.";
      }
    }

    setErrors(errors);
    return formIsValid;

  }

  return (
    <Box
      sx={{
        my: 3,
        mx: 4,
        pt: 5,
        pb: 5,
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
        borderTop: '1px solid gray',
        borderBottom: '1px solid gray'
      }}
    >
      <Typography className="full-width" component="h1" variant="h4" sx={{ mb: 2 }}>
        Sign in to Travelguru
      </Typography>
      <Typography variant="subtitle1" gutterBottom>
        Don't have an account? <Link color="#FF4F57" href="/">Sign up</Link>
      </Typography>
      <Box component="form" noValidate onSubmit={handleSubmit} sx={{ mt: 1 }}>
        <TextField
          value={formInitData.username}
          onChange={handleInputFields}
          margin="normal"
          required
          fullWidth
          id="username"
          label="Username"
          name="username"
          autoComplete="username"
          autoFocus
          helperText={errors?.username}
          error={errors?.username}
        />
        <TextField
          value={formInitData.email}
          onChange={handleInputFields}
          margin="normal"
          required
          fullWidth
          id="email"
          label="Email Address"
          name="email"
          autoComplete="email"
          autoFocus
          helperText={errors?.email}
          error={errors?.email}
        />
        <TextField
          value={formInitData.password}
          onChange={handleInputFields}
          margin="normal"
          required
          fullWidth
          name="password"
          label="Password"
          type="password"
          id="password"
          autoComplete="password"
          helperText={errors?.password}
          error={errors?.password}
        />
        {/* <IconButton sx={{ ml: 1 }} onClick={handlePasswordShow} color="inherit">
          {passwordVisible === false ? <VisibilityIcon /> : <VisibilityOffIcon />}
        </IconButton> */}

        <FormControl sx={{ m: 1, width: '25ch' }} variant="outlined">
          <OutlinedInput
            id="outlined-adornment-password"
            type={passwordVisible ? 'text' : 'password'}
            endAdornment={
              <InputAdornment position="end">
                <IconButton
                  aria-label="toggle password visibility"
                  onClick={handlePasswordShow}
                  // onMouseDown={handleMouseDownPassword}
                  edge="end"
                >
                  {passwordVisible ? <VisibilityOff /> : <Visibility />}
                </IconButton>
              </InputAdornment>
            }
            label="Password"
          />
        </FormControl>

        <Button
          type="submit"
          fullWidth
          variant="contained"
          className="btn-prm"
          sx={{ mt: 3 }}
        >
          Continue
        </Button>
      </Box>
    </Box>

  );
}

export default RegistrationForm;
